import React from 'react';
import Card from '@mui/material/Card';

import './largeCard.css';

function largeCard({title, quote}) {
  return (
    <Card sx={{ width: 350 , height: 500}}>
      <div>{title}</div>
    </Card>
  );
}

export default largeCard;
